import React,{useContext} from 'react'
import {Link} from 'react-router-dom'
import {DataContext} from '../context'
export default function Product() {

    const product = useContext(DataContext);

    return (
        <DataContext.Consumer>
        <div>
            {product.products}
        </div>
        /</DataContext.Consumer>
    )
}
